 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>\tWhat educational points are conveyed in the story<\/li>\n<li>\tWhat preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>\tWhere the case study fits into the rest of the course<\/li>\n<li>\tHow the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Analiza systuacji to obiekt zapewniaj\u0105cy uczniom \nsymulacj\u0119 maj\u0105c\u0105 pod\u0142o\u017ce edukacyjne. Analiza dotyczy sytuacji bazuj\u0105cej \n na rzeczywisto\u015bci i prosi uczni\u00f3w o zademonstrowanie lub opisanie jakie kroki  \nby podjeli aby rozwi\u0105za\u0107 zadanie lub wybrn\u0105\u0107 z danej sytuacji. Obiekt pozwala \n uczniom na u\u017cycie ich wiedzy i do\u015bwiadczenia do rozwi\u0105zania przypisanego \nzadania. Kiedy u\u017cywasz tego obiektu pami\u0119taj o: <ul> \n<li>\t Jakie tre\u015bci edukacyjne przekazuje tre\u015b\u0107<\/li>\n<li>\t Przyswojenia jakiej wiedzy potrzebuj\u0105 uczniowie do rozwi\u0105zania zadania  <\/li>\n<li>\t Czy zadanie pasuje do reszty lekcji <\/li>\n<li>\t Jak uczniowie b\u0119d\u0105 komunikowa\u0107 si\u0119 mi\u0119dzy sob\u0105 \n czy w sytuacji sali szkolnej, grupy mog\u0105 pracowa\u0107 nad r\u00f3\u017cnymi aspektami \n przypadku i jesli tak to jak zapewni\u0107 wsparcie klasie <\/li><\/ul>", 
